import React from 'react';
import { Grid, Paper } from '@material-ui/core';

const styles = theme => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    height: 140,
    width: 100,
  },
  control: {
    padding: theme.spacing.unit * 2,
  },
});

export default props => {
  return (
     <Grid container>
       <Grid item sm>
         <Paper style={styles.paper}>
          Left Pane
         </Paper>
       </Grid>
       <Grid item sm>
         <Paper style={styles.paper}>
          Right Pane
         </Paper>
       </Grid>
     </Grid>
  );
}
